ing on a three-yard touchdown grab early in the fourth quarter to cap off a 15-play, 90-yard march. Edmonds did see his lowest rushing workload of the season, although he'd come close to matching Thursday's sparse usage with a trio of three-carry games earlier in the campaign. The 2018 fourth-round pick now have multiple receptions in four straight contests and has crossed the goal line three times as a receiver on the season, which continues to give him fantasy utility in deeper full PPR formats. He'll look to put together another productive effort versus the Patriots in a Week 12 road tilt on Sunday, Nov. 29.\",\"title\":\"Scores as receiver in loss\"},{\"timeEpochMilli\":\"1605847601000\",\"contents\":\"Arizona Cardinals running back Chase Edmonds made the most of his minimal workload in Week 11 against the Seattle Seahawks. Edmonds carried the ball twice for 13 yards and caught all four of his targets for 36 yards and a touchdown. Kenyan Drake dominated carries in the game with 11. Drake was also surprisingly active in the passing game with five targets. Hopefully, for Edmonds' sake, that won't become a trend. Edmonds has had steady work in the passing game all year and because of it, he's ...\",\"url\":\"https://www.rotoballer.com/player-news/chase-edmonds-catches-touchdown-pass-on-thursday-night/806084\",\"title\":\"Chase Edmonds Catches Touchdown Pass On Thursday Night\"}],\"nameFirst\":\"Chase\",\"nameLast\":\"Edmonds\",\"proTeam\":{\"abbreviation\":\"ARI\",\"location\":\"Arizona\",\"name\":\"Cardinals\"},\"positionEligibility\":[\"RB\"]},\"requestedGames\":[{\"game\":{\"id\":6299,\"away\":{\"abbreviation\":\"ARI\",\"location\":\"Arizona\",\"name\":\"Cardinals\"},\"home\":{\"abbreviation\":\"SEA\",\"location\":\"Seattle\",\"name\":\"Seahawks\"},\"startTimeEpochMilli\":\"1605835200000\",\"status\":\"FINAL_SCORE\",\"awayScore\":21,\"homeScore\":28,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"WIN\",\"awayResu