:\"Performs well as lead back\"},{\"timeEpochMilli\":\"1605849673000\",\"contents\":\"Seattle Seahawks running back Carlos Hyde missed the last few games for the team, but he knocked off that rust en route to a strong day in Week 11 against the Arizona Cardinals on Thursday night. He finished the game with 14 carries for 79 yards and a touchdown. He also caught two of his three targets for 16 yards. It was clear by the workload split that he is the team's primary runner when teammate Chris Carson is out. He saw 16 touches compared to just nine for the other two active running ...\",\"url\":\"https://www.rotoballer.com/player-news/carlos-hyde-runs-well-in-week-11/806097\",\"title\":\"Carlos Hyde Runs Well In Week 11\"}],\"nameFirst\":\"Carlos\",\"nameLast\":\"Hyde\",\"proTeam\":{\"abbreviation\":\"SEA\",\"location\":\"Seattle\",\"name\":\"Seahawks\"},\"positionEligibility\":[\"RB\"]},\"requestedGames\":[{\"game\":{\"id\":6299,\"away\":{\"abbreviation\":\"ARI\",\"location\":\"Arizona\",\"name\":\"Cardinals\"},\"home\":{\"abbreviation\":\"SEA\",\"location\":\"Seattle\",\"name\":\"Seahawks\"},\"startTimeEpochMilli\":\"1605835200000\",\"status\":\"FINAL_SCORE\",\"awayScore\":21,\"homeScore\":28,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"WIN\",\"awayResult\":\"LOSE\"},\"stats\":[{\"category\":{\"id\":22,\"abbreviation\":\"Yd\",\"nameSingular\":\"Rushing Yard\",\"namePlural\":\"Rushing Yards\"},\"value\":{\"value\":79.0,\"formatted\":\"79\"}},{\"category\":{\"id\":175,\"abbreviation\":\"Rec\",\"nameSingular\":\"Target % Caught\",\"namePlural\":\"Target % Caught\"},\"value\":{\"value\":66.666664,\"formatted\":\"2/3\"}},{\"category\":{\"id\":42,\"abbreviation\":\"Yd\",\"nameSingular\":\"Receiving Yard\",\"namePlural\":\"Receiving Yards\"},\"value\":{\"value\":16.0,\"formatted\":\"16\"}},{\"category\":{\"id\":29,\"abbreviation\":\"TD\",\"nameSingular\":\"Offensive + Special Teams TD\",\"namePlural\":\"Offensive + Special 